import React from "react";
import './Header.css';
import { NavLink } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import {
    MDBNavbar,
    MDBNavbarNav,
    MDBNavbarItem,
    MDBNavbarLink,
    MDBNavbarToggler,
    MDBContainer,
    MDBIcon
  } from 'mdb-react-ui-kit';

function Header() {
    let navigate = useNavigate();
    return (
        <div>
            <header className="App-header">
            <NavLink to='/statistiques'>Accueil</NavLink>
            <NavLink to='/statistiques'>OneH</NavLink>
            <NavLink to='/statistiques'>SeveralH</NavLink>
            <NavLink to='/statistiques'>Statistiques</NavLink>
        </header>
        </div>
    );
}

export default Header;
